import React from 'react';

const InputElement = () => {
    constructor=()=>{
        this.state = {
            input: "abc"
        }

    }
    return (
        <div>
            <input placeholder="Enter some text" />
            {this.state.input}
        </div>

    )

}

export default InputElement;
